CREATE DEFINER=`root`@`localhost` FUNCTION `haversine` (`lat1` DOUBLE, `lon1` DOUBLE, `lat2` DOUBLE, `lon2` DOUBLE) RETURNS DOUBLE  BEGIN
    DECLARE R DOUBLE DEFAULT 6371; -- Rayon de la terre en kilomètres
    DECLARE dLat DOUBLE;
    DECLARE dLon DOUBLE;
    DECLARE a DOUBLE;
    DECLARE c DOUBLE;
    
